import React, { Component } from 'react';
import PropTypes from 'prop-types'
class Book extends Component{
  static propTypes = {
    categories: PropTypes.array.isRequired,
  }

  render (){
    const {categories} = this.props

    return(
      <div>
      <ol>
        {categories.map(category => 
          <li>{category.name}</li>
        )}
      </ol>
      </div>
    )
  }
}
export default Book
